import React from 'react';

const Navbar = () => {
    return (
        <nav className='nav'>
            <div>
                Profile
            </div>
            <div>
                Messages
            </div>
            <div>
                News
            </div>
            <div>
                Music
            </div>
            <div>
                Settings
            </div>
        </nav>
    );
};

export default Navbar;
